// import { useState } from 'react'
import './Form.css'

export default function Form () {
  let name, email, mobile
  const sendData = e => {
    e.preventDefault()
    // console.log('Call BTN')
    // console.log(name)
    // console.log(email)
    // console.log(mobile)

    fetch("https://jsonplaceholder.typicode.com/posts",{method: 'POST',body:JSON.stringify({name:name,email:email,mobile:mobile}),headers: {"Content-type" : "application/json; charset=UTF-8"
}
}).then((rowResponse) =>{rowResponse.json()}).then((json) =>{console.log(json)})
  }

  return (
    <div className='container_form'>
      <form>
        <div>
          <h1>Login To Continue...</h1>
        </div>
        <div>
          <input
            type='text'
            onChange={e => {
              id = e.target.value
            }}
            placeholder='Username'
          ></input>
        </div>
        <div>
          <input
            type='email'
            onChange={e => {
              email = e.target.value
            }}
            placeholder='User Email'
          ></input>
        </div>
        <div>
          <input
            type='text'
            onChange={e => {
              mobile = e.target.value
            }}
            placeholder='User Phone'
          ></input>
        </div>
        <button onClick={sendData}>Click Me</button>
      </form>
    </div>
  )
}
